import React from 'react'
import { Link } from 'react-router-dom'

export class ScoreItem extends React.Component{
    render(){
        console.log(this.props.match.params.id)
        return(
            <tr>
                <td>{elem.id}</td>
                <td><Link to={`/id${elem.id}`}>{elem.name}</Link></td>
                <td>{elem.startTime.hours}:{elem.startTime.minutes}</td>
                <td>{elem.stopTime.hours}:{elem.stopTime.minutes}</td>
                <td>{elem.duration}s</td>
            </tr>
        )
    }
}
